//rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:55:"https://www.echodesplugins.li-an.fr/plugins/wp-disable/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:75:"Normandie Incubation : l’incubation de Startup à Caen, Rouen et le Havre";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/10Stl6th0QY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:96:"https://www.wpnormandie.fr/normandie-incubation-lincubation-de-startup-a-caen-rouen-et-le-havre/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 10 Apr 2017 11:52:44 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:380:"\n		        Si vous avez un projet d&#8217;entreprise de type startup, certainement vous vous êtes posé la question de rentrer dans une structure de type incubateur. Nous sommes donc allés à la rencontre des équipes du plus connu dans la région : Normandie incubation. Nous avons demandé à Marion Oellers, la chargée de communication, de nous expliquer [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:18997:"<p>Si vous avez un projet d&rsquo;entreprise de type startup, certainement vous vous êtes posé la question de rentrer dans une structure de type <strong>incubateur</strong>. Nous sommes donc allés à la rencontre des équipes du plus connu dans la région : Normandie incubation. Nous avons demandé à <strong>Marion Oellers</strong>, la chargée de communication, de nous expliquer le rôle, les missions… bref de nous parler de l’incubateur. À noter que <a href="http://www.normandie-incubation.com/" target="_blank"><strong>Normandie incubation</strong></a> utilise WordPress pour son site internet. Elle nous en parle en fin de son intervention. À elle la parole ci-dessous :</p>\n<figure id="attachment_1281" style="width: 207px" class="wp-caption alignleft"><a href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/marion-normandie-incubation-207x247.png"><img class="wp-image-1281 size-full" src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/marion-normandie-incubation-207x247.png" alt="" width="207" height="247" /></a><figcaption class="wp-caption-text">Marion Oellers, Chargée de communication Normandie Incubation</figcaption></figure>\n<p>Nouvelle région Normandie, nouveaux horizons : depuis le 1er janvier 2017, les deux incubateurs normands se sont rapprochés pour former <strong>l’incubateur normand d’entreprises innovantes</strong> : Normandie Incubation.</p>\n<h2>Au commencement</h2>\n<p>Un incubateur, à la différence d’une pépinière d’entreprises, cible les <strong>jeunes entrepreneurs</strong>, souvent au stade de projet, et propose un <strong>ensemble de services</strong> adaptés au lancement de leur startup.</p>\n<p>Les projets en <strong>lien avec la recherche</strong> bénéficient d’une <strong>aide financière</strong> remboursable, sans prise de participation. Les autres <strong>projets innovants</strong> bénéficient des ressources et compétences humaines (accompagnement, formations…), physiques (hébergement) et organisationnelles de Normandie Incubation.</p>\n<h2>Au quotidien</h2>\n<p>Situé à <strong>Caen, Rouen et Le Havre</strong>, Normandie Incubation accueille les projets de création de startups et leur offre un <strong>hébergement</strong> à temps plein, des <strong>workshops</strong> sur mesure, un <strong>coaching</strong> personnalisé et l’accès au vivier d’entrepreneurs et experts Normands.</p>\n<blockquote>\n<figure id="attachment_1278" style="width: 207px" class="wp-caption alignright"><a href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/laurent-protin-normandie-incubation.png"><img class="wp-image-1278 size-full" src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/laurent-protin-normandie-incubation.png" alt="" width="207" height="254" /></a><figcaption class="wp-caption-text">Laurent PROTIN, directeur de Normandie Incubation</figcaption></figure>\n<p>« Nous sommes persuadés que les jeunes créateurs doivent être entourés d’autres startupers qui comprennent leurs problématiques »</p></blockquote>\n<p>Nos 5 coachs vous aident à peaufiner votre candidature. Ensuite vient l’heure du pitch devant des professionnels qui évaluent votre projet sous toutes les coutures et délibèrent sur votre entrée chez Normandie Incubation.</p>\n\n                \n                    \n                    #td_uid_1_58ed6f308a4e0  .td-doubleSlider-2 .td-item1 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/Cafétérie_NI-80x60.jpg) 0 0 no-repeat;\n                    }\n                    #td_uid_1_58ed6f308a4e0  .td-doubleSlider-2 .td-item2 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/Comité_Selection_NI2-80x60.jpg) 0 0 no-repeat;\n                    }\n                    #td_uid_1_58ed6f308a4e0  .td-doubleSlider-2 .td-item3 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/StartupTour_NI-3-80x60.jpg) 0 0 no-repeat;\n                    }\n                    #td_uid_1_58ed6f308a4e0  .td-doubleSlider-2 .td-item4 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/Workshop_NI-1-80x60.jpg) 0 0 no-repeat;\n                    }\n                \n\n                <div id="td_uid_1_58ed6f308a4e0" class="td-slide-on-2-columns">\n                    <div class="post_td_gallery">\n                        <div class="td-gallery-slide-top">\n                           <div class="td-gallery-title"></div>\n\n                            <div class="td-gallery-controls-wrapper">\n                                <div class="td-gallery-slide-count"><span class="td-gallery-slide-item-focus">1</span> de 4</div>\n                                <div class="td-gallery-slide-prev-next-but">\n                                    <i class="td-icon-left doubleSliderPrevButton"></i>\n                                    <i class="td-icon-right doubleSliderNextButton"></i>\n                                </div>\n                            </div>\n                        </div>\n\n                        <div class="td-doubleSlider-1 ">\n                            <div class="td-slider">\n                                \n                    <div class="td-slide-item td-item1">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Cafétérie_NI.jpg" title="Cafétérie_NI">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Cafétérie_NI-464x420.jpg" alt="">\n                            </a>\n                            <figcaption class="td-slide-caption td-gallery-slide-content"><div class="td-gallery-slide-copywrite">Cafétaria Normandie incubation</div></figcaption>\n                        </figure>\n                    </div>\n                    <div class="td-slide-item td-item2">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Comité_Selection_NI2.jpg" title="Comité_Selection_NI">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Comité_Selection_NI2-723x420.jpg" alt="">\n                            </a>\n                            <figcaption class="td-slide-caption td-gallery-slide-content"><div class="td-gallery-slide-copywrite">Comité de sélection Normandie Incubation</div></figcaption>\n                        </figure>\n                    </div>\n                    <div class="td-slide-item td-item3">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/StartupTour_NI-3.jpg" title="StartupTour_NI">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/StartupTour_NI-3-707x420.jpg" alt="">\n                            </a>\n                            <figcaption class="td-slide-caption td-gallery-slide-content"><div class="td-gallery-slide-copywrite">Startup Tour Normandie Incubation</div></figcaption>\n                        </figure>\n                    </div>\n                    <div class="td-slide-item td-item4">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Workshop_NI-1.jpg" title="Workshop_NI">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Workshop_NI-1-646x420.jpg" alt="">\n                            </a>\n                            <figcaption class="td-slide-caption td-gallery-slide-content"><div class="td-gallery-slide-copywrite">Workshop Normandie Incubation</div></figcaption>\n                        </figure>\n                    </div>\n                            </div>\n                        </div>\n\n                        <div class="td-doubleSlider-2">\n                            <div class="td-slider">\n                                \n                    <div class="td-button td-item1">\n                        <div class="td-border"></div>\n                    </div>\n                    <div class="td-button td-item2">\n                        <div class="td-border"></div>\n                    </div>\n                    <div class="td-button td-item3">\n                        <div class="td-border"></div>\n                    </div>\n                    <div class="td-button td-item4">\n                        <div class="td-border"></div>\n                    </div>\n                            </div>\n                        </div>\n\n                    </div>\n\n                </div>\n                \n<h2>La porte d’entrée</h2>\n<p>Si la magie opère, vous devenez un « incubé » ! Bienvenue dans l’aventure startup, démarrez dans les meilleures conditions : 18 mois d’accompagnement intense, de l’idée au démarrage commercial.</p>\n<p>« <em>Normandie Incubation nous a beaucoup aidé. L’équipe est présente pour vous conseiller sur tous les sujets : juridique, commerce, levées de fonds&#8230; Une aide complète sur les points importants de la création d’une entreprise</em> » Amance-Eudine Rouzier, fondatrice de la société <a href="https://www.wektoo.com/" target="_blank">Wektoo</a>.</p>\n<h2>La famille s’agrandit</h2>\n<p>Chaque mois, le comité de sélection se réunit pour étudier les nouvelles candidatures, alternant les sélections à Caen, Rouen et Le Havre. Depuis le 1er janvier, 10 projets ont rejoint l’incubateur, à l’instar de Swapbook à Caen, application pour revendre ses livres entre étudiants directement au sein de son campus, et de M Reality à Rouen, création d’applications basées sur les hologrammes avec un très grand réalisme physique.</p>\n<p><a href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Chiffres-clés-NI.jpg"><img class="aligncenter wp-image-1291 size-large" src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/Chiffres-clés-NI-1024x368.jpg" alt="" width="640" height="230" /></a></p>\n<h2>Notre utilisation de WordPress</h2>\n<p>Le site <a href="http://Normandie-Incubation.com" target="_blank">Normandie-Incubation.com</a> est construit sous WordPress.  Nous avons fait appel à une agence externe qui nous a mis en place le site Web. Notre utilisation de WordPress est sommes toute basique mais efficace pour nos besoins actuels. Je trouve WordPress intuitif et simple d’utilisation. L&rsquo;un des gros avantages de ce CMS est qu&rsquo;il a de nombreuses fonctionnalités disponibles qui peuvent répondre à bien des usages. Pour le site internet de l&rsquo;incubateur, nous utilisons essentiellement celles-ci :</p>\n<p>&#8211; Publication d&rsquo;articles / actualités / fiches startups<br />\n&#8211; Gestion des contacts entrants via le formulaire<br />\n&#8211; Réception de dossiers de candidature</p>\n<p>Nous envisageons d&rsquo;autres possibilités d&rsquo;utilisation du CMS pour permettre d&rsquo;avoir encore plus d&rsquo;efficacité dans nos relations avec nos futurs et actuels incubés. La souplesse de WordPress nous le permettra sans aucun doute. A noter que nous prenons parfois WordPress comme base de travail lors de nos Workshop.</p>\n<p>Captures d&rsquo;images du site internet de Normandie incubation :</p>\n\n                \n                    \n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item1 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-1-80x60.jpg) 0 0 no-repeat;\n                    }\n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item2 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-2-80x60.png) 0 0 no-repeat;\n                    }\n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item3 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-3-80x60.png) 0 0 no-repeat;\n                    }\n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item4 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-4-80x60.png) 0 0 no-repeat;\n                    }\n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item5 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-5-80x60.png) 0 0 no-repeat;\n                    }\n                    #td_uid_2_58ed6f308e618  .td-doubleSlider-2 .td-item6 {\n                        background: url(https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-6-80x60.png) 0 0 no-repeat;\n                    }\n                \n\n                <div id="td_uid_2_58ed6f308e618" class="td-slide-on-2-columns">\n                    <div class="post_td_gallery">\n                        <div class="td-gallery-slide-top">\n                           <div class="td-gallery-title"></div>\n\n                            <div class="td-gallery-controls-wrapper">\n                                <div class="td-gallery-slide-count"><span class="td-gallery-slide-item-focus">1</span> de 6</div>\n                                <div class="td-gallery-slide-prev-next-but">\n                                    <i class="td-icon-left doubleSliderPrevButton"></i>\n                                    <i class="td-icon-right doubleSliderNextButton"></i>\n                                </div>\n                            </div>\n                        </div>\n\n                        <div class="td-doubleSlider-1 ">\n                            <div class="td-slider">\n                                \n                    <div class="td-slide-item td-item1">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-1.jpg" title="site-normandie-incubation-1">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-1-313x420.jpg" alt="">\n                            </a>\n                            \n                        </figure>\n                    </div>\n                    <div class="td-slide-item td-item2">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-2.png" title="site-normandie-incubation-2">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-2-418x420.png" alt="">\n                            </a>\n                            \n                        </figure>\n                    </div>\n                    <div class="td-slide-item td-item3">\n                        <figure class="td-slide-galery-figure td-slide-popup-gallery">\n                            <a class="slide-gallery-image-link" href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-3.png" title="site-normandie-incubation-3">\n                                <img src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/site-normandie-incubation-3-140x420.png" al