amespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:45:"https://wabeo.fr/migration-donnees-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:72:"Carte des coworking, pépinières et hôtels d’entreprise en Normandie";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/4G0c9xLoxxw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:93:"https://www.wpnormandie.fr/carte-des-coworking-pepinieres-et-hotels-dentreprise-en-normandie/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 04 Apr 2017 08:57:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:379:"\n		        La carte des coworking, pépinière et hôtel d’entreprise en Normandie voit le jour sur le site de WPNormandie. Nous y travaillons depuis quelque temps, c’est enfin le moment de vous la mettre à disposition. Vous n’aurez plus aucune excuse maintenant pour faire du coworking en Normandie. Notre belle région regorge bien plus de lieux fort [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3996:"<p>La <a href="https://www.wpnormandie.fr/normandie/coworking-pepiniere-hotel-entreprise/">carte des coworking, pépinière et hôtel d’entreprise en Normandie</a> voit le jour sur le site de WPNormandie. Nous y travaillons depuis quelque temps, c’est enfin le moment de vous la mettre à disposition. Vous n’aurez plus aucune excuse maintenant pour faire du coworking en Normandie. Notre belle région regorge bien plus de lieux fort sympathiques pour faire du coworking que ce que l’on croyait.</p>\n<p>Vous pouvez donc maintenant voir sur une carte Google Map la localisation des lieux pouvant vous intéresser. Bien évidemment pour le moment tous les lieux ne sont pas rentrés.</p>\n<p>Sur toutes les pages du site vous verrez sur votre droite une image représentant un coworking. Cliquez dessus pour accéder à la page de la carte. Vous pouvez également y parvenir via le menu du site &laquo;&nbsp;<em>Normandie On T&rsquo;M -&gt; Coworking, Pépinière &amp; hôtel d&rsquo;entreprise</em>&nbsp;&raquo;</p>\n<h2>Contenus des fiches</h2>\n<p>Pour certaines fiches, nous n’avons pas reçu d’informations de la part du propriétaire. Dans ce cas nous avons rempli à minima son nom et son adresse. Une fois par an nous vérifierons le contenu de cette rubrique pour être certain que les informations sont bien à jour. Il va de soi que si le propriétaire nous demande de modifier le texte ou autre nous le ferons.</p>\n<p>D’ailleurs si vous êtes l’un d’entre eux, vous pouvez inscrire votre lieu via ce formulaire. Si vous voulez modifier des informations déjà saisies par nous pour vous utiliser le formulaire de contact en précisant l’URL de la fiche de votre lieu.</p>\n<p>Vous pourrez faire des recherches de lieux par :<br />\n• Catégorie (coworking, pépinière ou hôtel d’entreprises)<br />\n• Ville<br />\n• Code postal<br />\n• Latitude<br />\n• Longitude<br />\n• Nom de lieu</p>\n<p>Si vous autorisez votre navigateur à savoir votre position : la carte se centrera automatiquement sur cet endroit. Ainsi vous pourrez visualiser les coworking et autres proches de votre position. En cliquant sur l’icône du lieu sur la carte vous aurez accès à un résumé de la fiche. Dans ce résumé en cliquant sur le nom du lieu vous aurez la fiche en entier.</p>\n<h2>Évaluer les coworkings, pépinières ou hôtels d’entreprise</h2>\n<p>Autre nouveauté sur wpnormandie, vous allez pouvoir laisser une évaluation des lieux présents sur la carte. Pour cela, c’est très simple : il vous suffit de vous rendre sur une fiche de lieu. En bas de celle-ci vous avez un espace qui ressemble à un commentaire pour laisser votre évaluation. Toutefois bien évidemment il vous faudra être inscrit sur le site. Chaque évaluation sera visible dans la fiche du lieu.</p>\n<p>Le score qui s’affichera en haut est la moyenne de toutes les évaluations pour le lieu en question. L’évaluation se fait sur 10 et sera visible par des étoiles plus ou moins remplies en fonction de ce que vous aurez indiqué.</p>\n<p>Exemple d’évaluation vide</p>\n<p><a href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/eval-coworking-vierge.jpg"><img class="aligncenter size-medium wp-image-1109" src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/eval-coworking-vierge-300x125.jpg" alt="" width="300" height="125" /></a></p>\n<p>Exemple d’évaluation remplie</p>\n<p><a href="https://www.wpnormandie.fr/wp-content/uploads/2017/04/eval-coworking-ok.jpg"><img class="aligncenter size-medium wp-image-1108" src="https://www.wpnormandie.fr/wp-content/uploads/2017/04/eval-coworking-ok-300x244.jpg" alt="" width="300" height="244" /></a></p>\n<p>Lorsqu&rsquo;il y a déjà une ou plusieurs évaluations sur la fiche vous devez cliquer sur &laquo;&nbsp;Connectez-vous pour voter&nbsp;&raquo;.</p>\n<p>Qu&rsquo;en pensez vous de ces nouvelles fonctions sur le site ?</p><img src="http://feeds.feedburner.com/~r/wpfr/~4/4G0c9xLoxxw" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:93:"https://www.wpnormandie.fr/carte-des-coworking-pepinieres-et-hotels-dentreprise-en-normandie/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"[CONF] Faire du E-commerce en France avec WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/oBKPWfhkwcQ/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:77:"https://www.wpnormandie.fr/conf-faire-du-e-commerce-en-france-avec-wordpress/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 03 Apr 2017 16:14:51 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:410:"\n		        La version 3 de WooCommerce, l’extension e-commerce de WordPress arrivera demain. C’est l’occasion pour nous de vous faire découvrir la conférence de Rémi Corson d’Automattic. Cette conférence a eu lieu lors du WordCamp de Bordeaux et son sujet était : Faire du E-commerce en France avec WordPress. Vous y apprendrez un tas d’informations concernant non seulement [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1172:"<p>La version 3 de WooCommerce, l’extension e-commerce de WordPress arrivera demain. C’est l’occasion pour nous de vous faire découvrir la conférence de Rémi Corson d’Automattic. Cette conférence a eu lieu lors du WordCamp de Bordeaux et son sujet était : Faire du E-commerce en France avec WordPress.</p>\n<p>Vous y apprendrez un tas d’informations concernant non seulement l’e-commerce en France mais également des éléments liés à WooCommerce. À noter que Rémi aborde des points liés aux futurs développements de l’extension WooCommerce. C’est le cas de l’intégration avec Calypso.</p>\n<p>Pour ceux qui auraient raté l’interview de Rémi Corson faite aussi lors du WordCamp de Bordeaux, il suffit de regarder <a href="https://www.wpnormandie.fr/itw-wordcamp-bordeaux-woocommerce-version-3-remi-dautomattic-vous-en-parle/">cet article</a>.</p>\n<p>Voici donc la vidéo de la conférence sur l’ e-commerce en France avec WordPress. Cette vidéo dure environ 51 minutes car elle comprend également la séance de questions/réponses:</p>\n<p></p><img src="http://feeds.feedburner.com/~r/wpfr/~4/oBKPWfhkwcQ" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:77:"https://www.wpnormandie.fr/conf-faire-du-e-commerce-en-france-avec-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:81:"WP Mail Logging, l’extension pour enregistrer chaque mail envoyé par WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/tU53ZHsXHHM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:83:"https://wpchannel.com/wp-mail-logging-lextension-enregistrer-mail-envoye-wordpress/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 03 Apr 2017 09:37:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:434:"\n		        WP Mail Logging est une extension capable d&#8217;enregistrer chaque mail que WordPress envoie. L&#8217;intérêt majeur d&#8217;un tel outil est de faciliter le débogage de sites afin de s&#8217;assurer que ces derniers sont bien envoyés. Qui n&#8217;a jamais été confronté à un retour utilisateur l&#8217;informant de la non réception d&#8217;un mail ? WordPress utilise la fonction wp_mail() [&#8230;]\n		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"WP Channel";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:721:"<img width="400" height="300" src="https://wpchannel.com/images/2017/04/mailbox-400x300.jpg" class="webfeedsFeaturedVisual wp-post-image" alt="" style="margin: auto;margin-bottom: 5px;max-width: 100%" /><p>WP Mail Logging est une extension capable d&#8217;enregistrer chaque mail que WordPress envoie. L&#8217;intérêt majeur d&#8217;un tel outil est de faciliter le débogage de sites afin de s&#8217;assurer que ces derniers sont bien envoyés. Qui n&#8217;a jamais été confronté à un retour utilisateur l&#8217;informant de la non réception d&#8217;un mail ? WordPress utilise la fonction wp_mail() [&#8230;]</p>\n<p></p><img src="http://feeds.feedburner.com/~r/wpfr/~4/tU53ZHsXHHM" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:83:"https://wpchannel.com/wp-mail-logging-lextension-enregistrer-mail-envoye-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:52:"http://backend.userland.com/creativeCommonsRssModule";a:1:{s:7:"license";a:1:{i:0;a:5:{s:4:"data";s:49:"http://creativecommons.org/licenses/by-nc-sa/3.0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:2:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";s:4:"href";s:32:"http://feeds.feedburner.com/wpfr";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:2:{s:3:"rel";s:3:"hub";s:4:"href";s:32:"http://pubsubhubbub.appspot.com/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:4:"info";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:1:{s:3:"uri";s:4:"wpfr";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}}}}}}s:4:"type";i:128;s:7:"headers";O:42:"Requests_Utility_CaseInsensitiveDictionary":1:{s:7:"\0*\0data";a:11:{s:12:"content-type";s