(372, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/WordpressFrancophone/~3/scUWeRFptEQ/''>Compte rendu de la réunion du bureau du 9 mars 2017</a> <span class="rss-date">3 avril 2017</span><div class="rssSummary">Présent : Willy Bahuaud, Xavier, Borderie, Benoît Catherineau et Aurélien Denis L’élection du nouveau bureau a été clôturée le 4 mars 2017. Le résultat donne vainqueur les 3 candidats suivants : Benoît Catherineau, Xavier Borderie, Aurélien Denis. Cette réunion a pour objet l’installation du nouveau bureau de WPFR. L’ordre du jour Répartition des postes de Président, SecrétaireLire [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/SWfSjCFKiHs/''>ONE, notre thème premium chez WP Alacarte</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/IbZS2kDHlZU/''>WP Disable</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/10Stl6th0QY/''>Normandie Incubation : l’incubation de Startup à Caen, Rouen et le Havre</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Extensions populaires :</span> Jetpack by WordPress.com&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=jetpack&amp;_wpnonce=f67e4f0682&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Installer Jetpack by WordPress.com">(Installer)</a></li></ul></div>', 'no');
