(87, 2, '2016-04-23 15:40:23', '2016-04-23 13:40:23', '[vc_row el_class="padding-page"][vc_column][vc_row_inner gap="30" css=".vc_custom_1471434825560{background-color: #ffffff !important;}"][vc_column_inner][vc_column_text]\n<h3>1. Présentation du site.</h3>\nEn vertu de l''article 6 de la loi n° 2004-575 du 21 juin 2004 pour la confiance dans l''économie numérique, il est précisé aux utilisateurs du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> l''identité des différents intervenants dans le cadre de sa réalisation et de son suivi :\n\n<strong>Propriétaire</strong> : Emeline Sellier – 81854083300014 – 75016 PARIS\n<strong>Créateur</strong> : <a href="https://www.facebook.com/ohouais/">Grelet Julien</a>\n<strong>Responsable publication</strong> : Emeline Sellier – contact@sellier-avocat.fr\nLe responsable publication est une personne physique ou une personne morale.\n<strong>Webmaster</strong> : Grelet Julien – juliengrelet.pro@gmail.com\n<strong>Hébergeur</strong> : https://www.ovh.com/fr/ – 59100 Roubaix\nCrédits : les mentions légales ont été générées et offertes par Subdelirium <a href="http://www.subdelirium.com/creation-site-internet/" target="_blank">création de site internet</a>\n<h3>2. Conditions générales d’utilisation du site et des services proposés.</h3>\nL’utilisation du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> implique l’acceptation pleine et entière des conditions générales d’utilisation ci-après décrites. Ces conditions d’utilisation sont susceptibles d’être modifiées ou complétées à tout moment, les utilisateurs du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> sont donc invités à les consulter de manière régulière.\n\nCe site est normalement accessible à tout moment aux utilisateurs. Une interruption pour raison de maintenance technique peut être toutefois décidée par Emeline Sellier, qui s’efforcera alors de communiquer préalablement aux utilisateurs les dates et heures de l’intervention.\n\nLe site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> est mis à jour régulièrement par Emeline Sellier. De la même façon, les mentions légales peuvent être modifiées à tout moment : elles s’imposent néanmoins à l’utilisateur qui est invité à s’y référer le plus souvent possible afin d’en prendre connaissance.\n<h3>3. Description des services fournis.</h3>\nLe site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> a pour objet de fournir une information concernant l’ensemble des activités de la société.\n\nEmeline Sellier s’efforce de fournir sur le site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> des informations aussi précises que possible. Toutefois, il ne pourra être tenue responsable des omissions, des inexactitudes et des carences dans la mise à jour, qu’elles soient de son fait ou du fait des tiers partenaires qui lui fournissent ces informations.\n\nTous les informations indiquées sur le site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> sont données à titre indicatif, et sont susceptibles d’évoluer. Par ailleurs, les renseignements figurant sur le site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> ne sont pas exhaustifs. Ils sont donnés sous réserve de modifications ayant été apportées depuis leur mise en ligne.\n<h3>4. Limitations contractuelles sur les données techniques.</h3>\nLe site utilise la technologie JavaScript.\n\nLe site Internet ne pourra être tenu responsable de dommages matériels liés à l’utilisation du site. De plus, l’utilisateur du site s’engage à accéder au site en utilisant un matériel récent, ne contenant pas de virus et avec un navigateur de dernière génération mis-à-jour\n<h3>5. Propriété intellectuelle et contrefaçons.</h3>\nEmeline Sellier est propriétaire des droits de propriété intellectuelle ou détient les droits d’usage sur tous les éléments accessibles sur le site, notamment les textes, images, graphismes, logo, icônes, sons, logiciels.\n\nToute reproduction, représentation, modification, publication, adaptation de tout ou partie des éléments du site, quel que soit le moyen ou le procédé utilisé, est interdite, sauf autorisation écrite préalable de : Emeline Sellier.\n\nToute exploitation non autorisée du site ou de l’un quelconque des éléments qu’il contient sera considérée comme constitutive d’une contrefaçon et poursuivie conformément aux dispositions des articles L.335-2 et suivants du Code de Propriété Intellectuelle.\n<h3>6. Limitations de responsabilité.</h3>\nEmeline Sellier ne pourra être tenue responsable des dommages directs et indirects causés au matériel de l’utilisateur, lors de l’accès au site www.sellier-avocat.fr, et résultant soit de l’utilisation d’un matériel ne répondant pas aux spécifications indiquées au point 4, soit de l’apparition d’un bug ou d’une incompatibilité.\n\nEmeline Sellier ne pourra également être tenue responsable des dommages indirects (tels par exemple qu’une perte de marché ou perte d’une chance) consécutifs à l’utilisation du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a>.\n\nDes espaces interactifs (possibilité de poser des questions dans l’espace contact) sont à la disposition des utilisateurs. Emeline Sellier se réserve le droit de supprimer, sans mise en demeure préalable, tout contenu déposé dans cet espace qui contreviendrait à la législation applicable en France, en particulier aux dispositions relatives à la protection des données. Le cas échéant, Emeline Sellier se réserve également la possibilité de mettre en cause la responsabilité civile et/ou pénale de l’utilisateur, notamment en cas de message à caractère raciste, injurieux, diffamant, ou pornographique, quel que soit le support utilisé (texte, photographie…).\n<h3>7. Gestion des données personnelles.</h3>\nEn France, les données personnelles sont notamment protégées par la loi n° 78-87 du 6 janvier 1978, la loi n° 2004-801 du 6 août 2004, l''article L. 226-13 du Code pénal et la Directive Européenne du 24 octobre 1995.\n\nA l''occasion de l''utilisation du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a>, peuvent êtres recueillies : l''URL des liens par l''intermédiaire desquels l''utilisateur a accédé au site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a>, le fournisseur d''accès de l''utilisateur, l''adresse de protocole Internet (IP) de l''utilisateur.\n\nEn tout état de cause Emeline Sellier ne collecte des informations personnelles relatives à l''utilisateur que pour le besoin de certains services proposés par le site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a>. L''utilisateur fournit ces informations en toute connaissance de cause, notamment lorsqu''il procède par lui-même à leur saisie. Il est alors précisé à l''utilisateur du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> l’obligation ou non de fournir ces informations.\n\nConformément aux dispositions des articles 38 et suivants de la loi 78-17 du 6 janvier 1978 relative à l’informatique, aux fichiers et aux libertés, tout utilisateur dispose d’un droit d’accès, de rectification et d’opposition aux données personnelles le concernant, en effectuant sa demande écrite et signée, accompagnée d’une copie du titre d’identité avec signature du titulaire de la pièce, en précisant l’adresse à laquelle la réponse doit être envoyée.\n\nAucune information personnelle de l''utilisateur du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> n''est publiée à l''insu de l''utilisateur, échangée, transférée, cédée ou vendue sur un support quelconque à des tiers. Seule l''hypothèse du rachat de Emeline Sellier et de ses droits permettrait la transmission des dites informations à l''éventuel acquéreur qui serait à son tour tenu de la même obligation de conservation et de modification des données vis à vis de l''utilisateur du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a>.\n\nLe site n''est pas déclaré à la CNIL car il ne recueille pas d''informations personnelles. .\n\nLes bases de données sont protégées par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative à la protection juridique des bases de données.\n<h3>8. Liens hypertextes et cookies.</h3>\nLe site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> contient un certain nombre de liens hypertextes vers d’autres sites, mis en place avec l’autorisation de Emeline Sellier. Cependant, Emeline Sellier n’a pas la possibilité de vérifier le contenu des sites ainsi visités, et n’assumera en conséquence aucune responsabilité de ce fait.\n\nLa navigation sur le site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> est susceptible de provoquer l’installation de cookie(s) sur l’ordinateur de l’utilisateur. Un cookie est un fichier de petite taille, qui ne permet pas l’identification de l’utilisateur, mais qui enregistre des informations relatives à la navigation d’un ordinateur sur un site. Les données ainsi obtenues visent à faciliter la navigation ultérieure sur le site, et ont également vocation à permettre diverses mesures de fréquentation.\n\nLe refus d’installation d’un cookie peut entraîner l’impossibilité d’accéder à certains services. L’utilisateur peut toutefois configurer son ordinateur de la manière suivante, pour refuser l’installation des cookies :\n\nSous Internet Explorer : onglet outil (pictogramme en forme de rouage en haut a droite) / options internet. Cliquez sur Confidentialité et choisissez Bloquer tous les cookies. Validez sur Ok.\n\nSous Firefox : en haut de la fenêtre du navigateur, cliquez sur le bouton Firefox, puis aller dans l''onglet Options. Cliquer sur l''onglet Vie privée.\nParamétrez les Règles de conservation sur : utiliser les paramètres personnalisés pour l''historique. Enfin décochez-la pour désactiver les cookies.\n\nSous Safari : Cliquez en haut à droite du navigateur sur le pictogramme de menu (symbolisé par un rouage). Sélectionnez Paramètres. Cliquez sur Afficher les paramètres avancés. Dans la section "Confidentialité", cliquez sur Paramètres de contenu. Dans la section "Cookies", vous pouvez bloquer les cookies.\n\nSous Chrome : Cliquez en haut à droite du navigateur sur le pictogramme de menu (symbolisé par trois lignes horizontales). Sélectionnez Paramètres. Cliquez sur Afficher les paramètres avancés. Dans la section "Confidentialité", cliquez sur préférences. Dans l''onglet "Confidentialité", vous pouvez bloquer les cookies.\n<h3>9. Droit applicable et attribution de juridiction.</h3>\nTout litige en relation avec l’utilisation du site <a title="Emeline Sellier - www.sellier-avocat.fr" href="http://www.sellier-avocat.fr/">www.sellier-avocat.fr</a> est soumis au droit français. Il est fait attribution exclusive de juridiction aux tribunaux compétents de Paris.\n<h3>10. Les principales lois concernées.</h3>\nLoi n° 78-17 du 6 janvier 1978, notamment modifiée par la loi n° 2004-801 du 6 août 2004 relative à l''informatique, aux fichiers et aux libertés.\n\nLoi n° 2004-575 du 21 juin 2004 pour la confiance dans l''économie numérique.\n<h3>11. Lexique.</h3>\nUtilisateur : Internaute se connectant, utilisant le site susnommé.\n\nInformations personnelles : « les informations qui permettent, sous quelque forme que ce soit, directement ou non, l''identification des personnes physiques auxquelles elles s''appliquent » (article 4 de la loi n° 78-17 du 6 janvier 1978).[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Mentions légales', '', 'publish', 'closed', 'closed', '', 'mentions-legales', '', '', '2016-04-23 15:40:23', '2016-04-23 13:40:23', '', 0, 'http://elle-et-la.com/?page_id=87', 0, 'page', '', 0),
