(1313, 2, '2016-08-13 19:10:34', '2016-08-13 17:10:34', '[vc_row full_width="stretch_row" content_placement="middle" parallax="content-moving-fade" css=".vc_custom_1476278988249{background-position: center;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column][vc_row_inner content_placement="middle" gap="30" css=".vc_custom_1479810685497{margin-bottom: 30px !important;}"][vc_column_inner width="1/3"][vc_single_image image="1711" img_size="medium" alignment="center" css_animation="appear" el_class="img-agence"][/vc_column_inner][vc_column_inner width="2/3"][vc_column_text]elle&amp;la combine l''art et la manière, car les personnalités qui la composent sont des créatifs de cœur, et des professionnels façonnés par des parcours sérieux. Notre agence est aussi bien capable d''imaginer un design qui perdure, que de mener un audit dans les règles, d''optimiser les référencements médiatiques, que de positionner une communication avec impact. elle&amp;la combine l''art et la matière, car elle a l''expertise technique et les compétences technologiques au service de son imagination.[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner content_placement="middle" gap="30" css=".vc_custom_1479810691011{margin-bottom: 30px !important;}"][vc_column_inner width="1/3"][vc_single_image image="1720" img_size="medium" alignment="center" css_animation="appear" el_class="img-agence"][/vc_column_inner][vc_column_inner width="2/3"][vc_column_text]Dans notre métier, il faut être artiste ! Mais avec raison et rigueur. Car accompagner une entreprise, un projet, une marque ou un événement ne requiert pas seulement de générer une identité visuelle, un support éditorial - digital - interactif original. Encore faut-il qu''il soit adapté et cohérent pour devenir percutant et toucher vos cibles.[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner content_placement="middle" gap="30"][vc_column_inner width="1/3"][vc_single_image image="1721" img_size="medium" alignment="center" css_animation="appear" el_class="img-agence"][/vc_column_inner][vc_column_inner width="2/3"][vc_column_text]La communication ne s''improvise pas, ni dans le fond ni dans la forme.\nPour mettre technologies et innovations au service de votre déploiement, elle&amp;la possède l''expertise de ces nouveaux outils digitaux et le réseau de spécialistes qui complètent son savoir-faire. Lorsque les projets le nécessitent, elle&amp;la configure une équipe sur-mesure en s''enrichissant de la proximité de son réseau d’experts.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Agence', '', 'publish', 'closed', 'closed', '', 'agence', '', '', '2016-08-13 19:10:34', '2016-08-13 17:10:34', '', 0, 'http://elle-et-la.com/?page_id=1313', 0, 'page', '', 0),
