(1644, 2, '2016-10-11 17:03:51', '2016-10-11 15:03:51', '[vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481144373131{margin-bottom: 20px !important;}"]Client\n<strong>Agence Première pour Carval et Prime Capital Partners</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Recherche de nom\nCréation  logo et identité visuelle\nPlaquette de commercialisation </strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]\n<p class="adresse-actifs">Allure : des bureaux de caractère\n101-109, rue Jean Jaurès - Levallois Perret (92)</p>\nAfin de mettre en valeur le caractère de cette immeuble de bureaux et en valoriser les atouts, elle&amp;la est intervenu en amont dans la recherche de nom de ces nouveaux locaux. L''Agence en a créé l''identité visuelle complète : logotype, maquette éditoriale, création d''éléments graphiques, traitement des plans à destination d''une brochure de commercialisation.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1479825035193{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/10/banner-project.jpg?id=1679) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1481641736272{background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column][vc_single_image image="1688" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191517602{padding-top: 120px !important;padding-bottom: 60px !important;}"][vc_single_image image="1692" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191551849{margin-bottom: 30px !important;padding-top: 60px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1481641743018{background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column width="1/2"][vc_single_image image="2317" img_size="full" alignment="center" css_animation="appear"][/vc_column][vc_column width="1/2"][vc_single_image image="2272" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191596191{margin-bottom: 30px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1481641748299{background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column][vc_single_image image="2273" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191611942{margin-bottom: 30px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1481641753693{background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column width="2/3"][vc_single_image image="2852" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481192204560{margin-bottom: 30px !important;}"][/vc_column][vc_column width="1/3"][vc_single_image image="2283" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191640748{margin-bottom: 30px !important;}"][vc_single_image image="2280" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481191655009{margin-bottom: 30px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1481641760456{padding-top: 30px !important;padding-bottom: 60px !important;}"][vc_column][vc_column_text]\n<p style="text-align: center;">crédits photos © Franck Juery</p>\n[/vc_column_text][/vc_column][/vc_row]', 'Allure', '', 'publish', 'open', 'open', '', 'allure', '', '', '2016-10-11 17:03:51', '2016-10-11 15:03:51', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=1644', 1, 'projet', '', 0),
(1658, 2, '2016-10-12 10:02:33', '2016-10-12 08:02:33', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481144458298{margin-bottom: 20px !important;}"]Client\n<strong>Infime Architecture</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Création du site internet vitrine</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]Infime Architecture offre à l''ensemble du secteur de la promotion immobilière, depuis plus de 15 ans, des contenus interactifs, des vidéos et des produits 3D haut de gamme. Lorsqu''ils ont décidé de refondre leur site, leur souhait : <strong>mettre en lumière ces images et ces réalisations digitales au service de la valorisation des bâtiments et des plans 3D décorés</strong> qu''ils réalisent. Sobriété et élégance pour laisser parler les images d''elles-mêmes.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" css=".vc_custom_1480522452712{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/10/banner-infime-1.jpg?id=2374) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces" css=".vc_custom_1479741589315{background-color: #ffffff !important;}"][vc_column][vc_row_inner content_placement="middle"][vc_column_inner width="1/2" offset="vc_col-sm-offset-0"][vc_single_image image="1876" img_size="full" alignment="center" css_animation="appear"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="1879" img_size="large" alignment="center" css_animation="appear"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" css=".vc_custom_1480523914729{padding-top: 60px !important;padding-bottom: 60px !important;background-color: #f3f4f9 !important;}"][vc_column][vc_row_inner content_placement="middle"][vc_column_inner width="1/4" offset="vc_col-sm-offset-0"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="2660" img_size="full" alignment="center" css_animation="appear"][/vc_column_inner][vc_column_inner width="1/4"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Infime Architecture', '', 'publish', 'open', 'open', '', 'infime-architecture', '', '', '2016-10-12 10:02:33', '2016-10-12 08:02:33', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=1658', 2, 'projet', '', 0),
