(1893, 2, '2016-11-10 16:41:48', '2016-11-10 15:41:48', '[vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481146767213{margin-bottom: 20px !important;}"]Client\n<strong>LB Développement pour Protelco</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Logotype Mission Handicap\nWebsérie\nSupports éditoriaux</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]elle&amp;la collabore étroitement avec l''agence LB Développement, spécialisée dans l''emploi des personnes handicapées, dans la réalisation de supports de communication à destination des services RH des entreprises. Les actions réalisées pour Protelco, filiale de Free, visent à sensibiliser les collaborateurs au thème du Handicap et de sa reconnaissance dans le monde professionnel.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_single_image image="1959" img_size="full" alignment="center" css_animation="appear"][vc_single_image image="1980" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479207290833{padding-bottom: 60px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces" content_placement="middle" css=".vc_custom_1479296382622{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/11/video_capture_protelco.png?id=1901) !important;}"][vc_column][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner css=".vc_custom_1479140561596{padding-top: 60px !important;}"][vc_column_text]\n<p style="text-align: center;">Dans cette campagne globale de communication, l''agence a réalisé le logo Mission Handicap Protelco.\nUne série de supports éditoriaux et une webserie ont accompagné cette démarche.\n<strong>Aborder avec humour sans tabou les questions liées au sujet du handicap</strong>, voici comment nous pourrions résumer cette campagne.</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_single_image image="1898" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479140204569{padding-top: 80px !important;padding-bottom: 80px !important;}"][vc_single_image image="1900" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479140219552{padding-top: 80px !important;padding-bottom: 80px !important;}"][vc_single_image image="1895" img_size="full" alignment="center" css_animation="appear"][vc_single_image image="1899" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479207319343{padding-top: 15px !important;padding-bottom: 60px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column width="1/4"][vc_single_image image="1902" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1906" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1927" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1913" img_size="full" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][vc_single_image image="1903" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1907" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1910" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1968" img_size="full" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][vc_single_image image="1904" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1933" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1911" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1967" img_size="full" alignment="center" css_animation="bottom-to-top"][/vc_column][vc_column width="1/4"][vc_single_image image="1924" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1908" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1930" img_size="full" alignment="center" css_animation="bottom-to-top"][vc_single_image image="1925" img_size="full" alignment="center" css_animation="bottom-to-top"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner][vc_column_text]\n<p style="text-align: center;">crédits photos © Franck Juery</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Protelco', '', 'publish', 'open', 'open', '', 'protelco', '', '', '2016-11-10 16:41:48', '2016-11-10 15:41:48', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=1893', 10, 'projet', '', 0),
