(2075, 2, '2016-11-15 15:07:46', '2016-11-15 14:07:46', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481146526849{margin-bottom: 20px !important;}"]Client\n<strong>L''Atelier RH</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Logotype\nIdentité visuelle\nSite internet\nAnimation</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]L''Atelier RH est un cabinet de consulting à destination des entreprises qui souhaitent élaborer des outils RH pragmatiques pour motiver, évaluer, adapter et développer le capital humain de leurs équipes. Notre accompagnement auprès de Carole Pilet, la créatrice, c''est fait en toute symbiose ; partageant ensemble cette valeur que l''humain est au cœur de notre vision d''entreprise et de notre performance. La création de son logotype et le choix de sa signature<strong> Plus proche pour aller plus loin</strong> étaient pour nous le souhait de raconter, avec très peu d''éléments, la genèse de l''Atelier RH et de ses ambitions.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" css=".vc_custom_1480519489772{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/11/atelier_rh_01.png?id=2077) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column offset="vc_hidden-lg vc_hidden-md vc_hidden-sm vc_hidden-xs"][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_row_inner][vc_column_inner width="1/2"][vc_single_image image="2097" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481041639