(2177, 2, '2016-11-16 09:39:54', '2016-11-16 08:39:54', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481145733815{margin-bottom: 20px !important;}"]Client\n<strong>World Corp pour Who''s Who</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Application smartphone\nApple et Android\nAnimation</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]Le Who''s Who in France est l''ouvrage de référence des <span class="bold">22 000 <em class="noref">personnalités</em></span> actives <em class="noref">françaises</em> remarquables par leur travail et leurs talents dans toutes les <em class="noref">spécialités</em> : entrepreneurs et dirigeants d''entreprises, scientifiques, artisans et artistes, journalistes, hauts fonctionnaires, sportifs, professions libérales...[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" css=".vc_custom_1480521278169{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/11/whoswho_banner_video.jpg?id=2231) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478102325510{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">À la demande de la société World Corp, elle&amp;la s''est attelé à créer l''ensemble des templates de la nouvelle application du Who''s Who (Apple et Android) avec un double objectif : mettre en valeur les atouts de l''offre Who''s Who en pleine évolution ; placer l''utilisateur au centre de notre réflexion et de notre travail. Un guide de charte détaillé a été également réalisé afin d''optimiser le recettage et de faire gagner du temps aux équipes de développement.</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_row_inner][vc_column_inner width="1/6"][vc_single_image image="2186" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286205970{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][vc_column_inner width="1/6"][vc_single_image image="2187" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286188584{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][vc_column_inner width="1/6"][vc_single_image image="2184" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286229645{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][vc_column_inner width="1/6"][vc_single_image image="2185" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286218074{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][vc_column_inner width="1/6"][vc_single_image image="2182" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286270524{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][vc_column_inner width="1/6"][vc_single_image image="2183" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479286255012{padding-top: 15px !important;padding-bottom: 15px !important;}"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_row_inner][vc_column_inner css=".vc_custom_1479286459325{background-color: #f3f4f8 !important;}"][vc_single_image image="2210" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1479293848730{padding-top: 90px !important;padding-right: 15px !important;padding-bottom: 90px !important;padding-left: 15px !important;}"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1481197649118{padding-top: 60px !important;padding-bottom: 0px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">Le concept et la création du hashtag <strong>#talentsmadeinfrance</strong> ont été proposé au Who''s Who,\naccompagné de cette animation qui revient sur les grands points clefs de l''offre.</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column][vc_raw_html css=".vc_custom_1481192437810{padding-top: 90px !important;padding-right: 15px !important;padding-bottom: 15px !important;padding-left: 15px !important;}"][/vc_raw_html][/vc_column][/vc_row]', 'Who&#039;s who', '', 'publish', 'open', 'open', '', 'whos-who', '', '', '2016-11-16 09:39:54', '2016-11-16 08:39:54', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=2177', 5, 'projet', '', 0),
