(2448, 2, '2016-12-05 15:15:26', '2016-12-05 14:15:26', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481146219622{margin-bottom: 20px !important;}"]Client\n<strong>Ineo Support Global\nIneo Défense\n</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Accompagnement global\nSupports éditoriaux et digitaux\nSupports événementiels\n</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]Nous avons le plaisir de collaborer depuis plus de 8 ans avec INEO SUPPORT GLOBAL, filiale du Groupe Engie.\nLes missions que nous avons menées ont un champ d''actions vaste : accompagnement et conseil à la réalisation de supports de communication corporate externe et interne ; contenus et supports événementiels pour les salons Eurosatory et Le Bourget ; réalisation d''un site internet dans le cadre d''un projet de maintien de la Paix en territoire étranger ; communication diverse pour les offres INEO DEFENSE et GRIFFES DEFENSE.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" parallax="content-moving" css=".vc_custom_1481033229953{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/12/isg_multisupports.png?id=2540) !important;background-position: center;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column offset="vc_hidden-md vc_hidden-sm vc_hidden-xs"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1480520323761{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">Ces années nous ont permis de développer une connaissance fouillée et précise de leur offre de services - souvent perçue comme complexe et technique - et nous permet de rendre accessible et de mettre en images leurs messages clefs.</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner][vc_column_inner][vc_single_image image="2534" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481033290426{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner width="1/2"][vc_single_image image="2536" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481033295221{padding-bottom: 30px !important;}"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="2551" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481033603708{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2538" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481033282297{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2892" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481195763037{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner width="1/2"][vc_single_image image="2539" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481195074372{margin-bottom: 30px !important;}"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="2535" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481195082669{margin-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2882" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481195067474{margin-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478111010136{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">crédits photos © Ineo Support Global © Franck Juery</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Ineo Support Global / Ineo Defense', '', 'publish', 'open', 'open', '', 'ineo', '', '', '2016-12-05 15:15:26', '2016-12-05 14:15:26', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=2448', 7, 'projet', '', 0),
