(2478, 2, '2016-12-06 10:19:34', '2016-12-06 09:19:34', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481143287590{margin-bottom: 20px !important;}"]Client\n<strong>Groupe GA\n</strong>[/vc_column_text][vc_column_text]Projet\nCréation d''un coffret et supports éditoriaux[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]Dans le cadre d''une réponse à appel d''offre pour la construction d''un immeuble de bureaux à Bordeaux Saint-Jean Belcier, le Groupe GA a fait appel aux services de l''agence pour concevoir un coffret complet de remise de l''offre. Un projet graphique, moderne et dynamique au service d''une intention architecturale pleinement intégrée dans le cadre de la ville de Bordeaux.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces" content_placement="middle" css=".vc_custom_1481023134001{background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}"][vc_column][vc_single_image image="2502" img_size="full" alignment="center" css_animation="appear"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1480520323761{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">Deux plaquettes composent ce coffret : remise de l''offre et présentation du projet.\nCi-dessous quelques éléments de détails : couvertures, pages Mag et intention artistique.</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner][vc_column_inner][vc_single_image image="2493" img_size="full" css_animation="appear" css=".vc_custom_1481023567003{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner width="1/2"][vc_single_image image="2516" img_size="full" css_animation="appear" css=".vc_custom_1481024005499{padding-bottom: 30px !important;}"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="2517" img_size="full" css_animation="appear" css=".vc_custom_1481024048774{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2424" img_size="full" css_animation="appear" css=".vc_custom_1481023690961{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner width="1/2"][vc_single_image image="2421" img_size="full" css_animation="appear" css=".vc_custom_1481063820595{margin-bottom: 30px !important;}"][/vc_column_inner][vc_column_inner width="1/2"][vc_single_image image="2495" img_size="full" css_animation="appear"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478111010136{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\n<p style="text-align: center;">crédits photos © Franck Juery</p>\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', '# LIVE', '', 'publish', 'open', 'open', '', 'live', '', '', '2016-12-06 10:19:34', '2016-12-06 09:19:34', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=2478', 0, 'projet', '', 0),
