(2556, 2, '2016-12-06 15:20:33', '2016-12-06 14:20:33', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481146171549{margin-bottom: 20px !important;}"]Client\n<strong>Engie\n</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Identité visuelle de l''offre Terr''Innove</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]Pour la Direction de l''innovation d''Engie, elle&amp;la a réalisé la plaquette de son offre transverse <strong>Terr''Innove</strong>, en trois langues.\nIl s''agissait de mettre en image le concept d''<strong>énergie nouvelle au service du territoire</strong>, expliciter la vision de co-construire et de concrétiser une nouvelle stratégie énergétique territoriale, dresser un état des lieux des besoins des collectivités.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner][vc_column_inner][vc_single_image image="2889" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481195695289{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2558" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481034120630{padding-bottom: 30px !important;}"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_single_image image="2544" img_size="full" alignment="center" css_animation="appear"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478111010136{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_colu