c_column][vc_row_inner][vc_column_inner][vc_single_image image="2737" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481143462134{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_raw_html][/vc_raw_html][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1481192136736{padding-top: 0px !important;padding-bottom: 50px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-lg-8 vc_col-md-offset-2 vc_col-md-8 vc_col-sm-offset-2"][vc_column_text]Durant les 6 dernières années, l''agence a également réalisé l''habillage des tentes sur les événements MIPCOM et MIP TV à Cannes pour le compte de la société Orati. Chaque année un nouveau thème a été mis en avant - ci-dessous le programme Stars in Dangers HighDive.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_row_inner][vc_column_inner][vc_single_image image="2823" img_size="full" alignment="center" css_animation="appear"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478111010136{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text]\r\n<p style="text-align: center;">réalisation de la tente - MIP à Cannes : Orati\r\ncrédits photos © Franck Juery © Banijay</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Banijay', '', 'publish', 'open', 'open', '', 'banijay', '', '', '2017-01-18 15:20:27', '2017-01-18 14:20:27', '', 0, 'http://elle-et-la.com/?post_type=projet&#038;p=2742', 0, 'projet', '', 0),
(2776, 2, '2016-12-07 22:30:25', '2016-12-07 21:30:25', '[vc_row][vc_column][vc_row_inner css=".vc_custom_1478103912681{padding-bottom: 50px !important;}"][vc_column_inner el_class="infos-project-detail" width="1/4" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-2"][vc_column_text el_class="infos-project" css=".vc_custom_1481146113577{margin-bottom: 20px !important;}"]Client\n<strong>Site GPR</strong>[/vc_column_text][vc_column_text]Projet\n<strong>Wireframe et webdesign\nIncentive online\nSupports événementiels\n</strong>[/vc_column_text][/vc_column_inner][vc_column_inner width="5/12"][vc_column_text]SiteGPR® propose un ensemble d’outils digitaux pour le bon usage clinique du médicament auprès des professionnels de santé. Dans le cadre de la refonte de leur site, l''agence a réalisé l''ensemble des wireframes des templates responsives du site ainsi que son webdesign. Une charte digitale complète détaillée a été remise au prestataire choisi par SiteGPR® pour assurer le bon déroulement de la partie développement.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" css=".vc_custom_1481146220149{background-image: url(http://elle-et-la.com/wp-content/uploads/2016/12/site_GPR_banner.jpg?id=2723) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}" el_class="banner-project"][vc_column][vc_raw_html][/vc_raw_html][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_single_image image="2934" img_size="full" alignment="center" css_animation="appear"][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces"][vc_column][vc_single_image image="2914" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481207538619{padding-top: 60px !important;padding-bottom: 30px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1481207511916{padding-top: 30px !important;padding-bottom: 30px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-0"][vc_column_text]À destination des praticiens, a été lancée une campagne incentive GPR CONNECT. Un kit de communication leur a été remis. <strong>Objectif : devenir ambassadeur de la communauté et permettre à leur réseau de découvrir un outil d''aide à la prescription et au bon usage du médicament en ayant toutes les informations médicamenteuses complètes mises à jour</strong>. Interactions médicamenteuses, recommandation sur la prise de médicament pendant la grossesse, définition de la fonction rénale chez l''adulte…autant de problématiques pour lesquelles SiteGPR® développe de nouveaux outils.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row" content_placement="middle" css=".vc_custom_1481641591587{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column][vc_single_image image="2917" img_size="full" alignment="center" css_animation="appear"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_single_image image="2915" img_size="full" alignment="center" css_animation="appear" css=".vc_custom_1481206691540{padding-top: 30px !important;}"][/vc_column][/vc_row][vc_row full_width="stretch_row"][vc_column][vc_row_inner css=".vc_custom_1478102325510{padding-top: 60px !important;padding-bottom: 60px !important;}"][vc_column_inner width="2/3" offset="vc_col-lg-offset-2 vc_col-md-offset-2 vc_col-sm-offset-0"][vc_column_text]elle&amp;la a réalisé l''ensemble des supports événementiels destinés aux divers salons professionnels : stand parapluie, signalétique stand, panneaux, enseigne…[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row full_width="stretch_row_content_no_spaces" css=".vc_custom_1481207126450{margin-bottom: 60px !important;background-color: #f7f7f7 !import